Answer: The member of the Birmingham Press Club who re-examined the Lindbergh kidnapping case is:
\begin{blockquote}
John F. Condon
\end{blockquote}
John F. Condon, a journalist and former member of the Birmingham Press Club, reopened the Lindbergh case in 1932 and, after a series of interviews with Bruno Hauptmann's former wife, found evidence that implicated Hauptmann in the crime. Condon's work led to Hauptmann's execution in 1936.
